import React from 'react';

const Education = () => {
  return (
    <section id="education">
      <h2>Education</h2>
      <ul>
        <li><strong>School:</strong> CHRIST KING HIGH SCHOOL</li>
        <li><strong>College:</strong> GAUHATI COMMERCE COLLEGE</li>
        <li><strong>Degree:</strong> ASSAM DOWNTOWN UNIVERSITY</li>
      </ul>
    </section>
  );
};

export default Education;
